import React from 'react';
import './App.css';
import DogFilter from './DogFilter'

export default class App extends React.Component {

  state = {
    dogs: []
  }

  getDogs = () => {
    fetch('http://localhost:3000/pups')
      .then(res => res.json())
      .then(pups => {
        this.setState({
          dogs: pups
        })
      })
  }



  render(){
  return (
    <div className="App">
      <div id="filter-div">
        <DogFilter /> 
      </div>
      <div id="dog-bar">
          <img src={this.state.dogs.map(dog => {
            return dog['image'] } )}>

            </img>
      </div>
      <div id="dog-summary-container">
        <h1>DOGGO:</h1>
        <div id="dog-info">

        </div>
      </div>
    </div>
  );
  }
}
